import { StatusBar } from 'expo-status-bar';
import React, {useState, useEffect} from 'react';
import { StyleSheet, Text, View, Image, Button, Alert, TextInput, AppRegistry } from 'react-native';

const RegistrationScreen = () =>{

    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");

    const [isSubmit, setIsSubmit] = useState(false);

    const usernameHandler = (text) =>{
        //validations
        setUsername(text);
    }

    return (
        <View style={styles.container}>
            <Text style={styles.colorr}>UCYP</Text>
            <Image
        style={styles.logo}
        source={{
          uri: 'https://www.ucyp.edu.my/wp-content/uploads/2018/06/xlogo-UCYP-02-3.png.pagespeed.ic_.xhDmre2uYj.png',
        }}
      />
            <TextInput
             placeholder="Username" 
             autoCapitalize="none"
             style={styles.inputStyle} 
             onChangeText={usernameHandler}/>
            <TextInput 
            placeholder="Password" 
            autoCapitalize="none"
            style={styles.inputStyle}
            secureTextEntry={true} />
            <Button title="Log In" onPress={() => setIsSubmit(true) }/>
        </View>
    )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#000',
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo: {
      height: 104,
      width: 274
  },
  inputStyle: {
      backgroundColor: "#fff",
      borderBottomColor: "#fff",
      borderTopColor: "#fff",
      borderLeftColor: "#fff",
      borderRightColor: "#fff",
      borderBottomWidth: 1,
      borderTopWidth: 1,
      borderLeftWidth: 1,
      borderRightWidth: 1,
      marginBottom: 5
  },
  colorr: {
    color: "white",
    fontSize: 40
  }
});

export default RegistrationScreen;
